  if (mes >= 3 && mes <= 5) return "🍂"; // Otoño
  if (mes >= 6 && mes <= 8) return "❄️"; // Invierno
  if (mes >= 9 && mes <= 11) return "🌸"; // Primavera
  return "☀️"; // Verano
}

